import { Fragment } from "react";

import mealsImg from '../../assets/meals.jpg'
import classes from './Header.module.css'

const Header = props => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        <button>Cart</button>
      </header>
      <div>
        <img
          src={mealsImg}
          className={classes['main-image']}
        />
      </div>
    </Fragment>
  );
};

export default Header;
